import { StyleSheet } from "react-native";

export default StyleSheet.create({
    pag:{
        alignItems: 'center',
        backgroundColor: "#eee",
        flex: 1
    },
    imgH:{
        width:400,
        height:150
    },
    cards:{
        backgroundColor:'#fefefe',
        borderWidth:1,
        borderColor:'#ccc',
        margin: 5,
        padding: 5,
        display: 'flex',
        flexDirection: 'row',
        justifyContent:'space-around'
    }
});
